The Active Message layer on the Telos platform. This is a naming wrapper
around the CC2420 Active Message layer.

@author Philip Levis
@version $Revision: 1.9 $ $Date: 2010-06-29 22:07:55 $

The Active Message layer for the CC2420 radio. This configuration
just layers the AM dispatch (CC2420ActiveMessageM) on top of the
underlying CC2420 radio packet (CC2420CsmaCsmaCC), which is
inherently an AM packet (acknowledgements based on AM destination
addr and group). Note that snooping may not work, due to CC2420
early packet rejection if acknowledgements are enabled.

@author Philip Levis
@author David Moss
@version $Revision: 1.16 $ $Date: 2010-06-29 22:07:44 $

Radio wiring for the CC2420.  This layer seperates the common
wiring of the lower-layer components of the CC2420 stack and makes
them available to clients like the AM stack and the IEEE802.15.4
stack.

This component provides the highest-level internal interface to
other components of the CC2420 stack.

@author Philip Levis
@author David Moss
@author Stephen Dawson-Haggerty
@version $Revision: 1.2 $ $Date: 2009/08/20 01:37:44 $

